import React , {Component} from 'react';

export default class CommentListItem  {
  render() {
    const { inputs } = this.props;
    return
        (
          <div>
         {
           inputs.map( (inputs ) => {
             return(
             <div>
               {inputs.author}
               {inputs.props.commentText}
            </div>
          )})
        }
        </div>
    )
  };
}
